import React, {Component} from 'react';


class App extends Component{
    render(){
        return(
            <div className='container-fluid bg' style={{display:'flex', flexDirection:'column', justifyContent:'center', padding: 0}}>
               
                <div  className='' style={{backgroundColor:'#C3DDDD80', height: '32vh'}}>
                </div>
                
            </div>

        )
    }
}

export default App
